import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({ children, color, ...otherProps }) => (
    <button className={ color ? `custom-button ${[color]}` : 'custom-button'}
    {...otherProps}>
        {children}
    </button>
)

export default CustomButton;
